import "./SearchList.css";
import dataSearch from "../../data/search.json";
const SearchList = () => {
  return (
    <div className="card-searchlist">
      <img></img>
      <div>
        <h2>name</h2>
        <p>distance</p>
        <p>tag</p>
        <h3>description</h3>
        <p>type</p>
        <p>freecancellation</p>
        <p>you can cancel later, so lock in this great price today!</p>
      </div>
      <div>
        <div>
          <p>rate text</p>
          <p>rate</p>
        </div>
        <p>price</p>
        <p>Includes taxes and fees</p>
        <button></button>
      </div>
    </div>
  );
};
export default SearchList;
